import React from 'react';

const ProfilePage = () => {
  return (
    <div className="flex flex-row">
      {/* Profile Picture */}
      <div className="w-1/4 p-4">
        <img
          src="img/Screenshot (161).png"
          alt="Profile"
          className="w-32 h-32 rounded-full"
        />
      </div>

      {/* Profile Details */}
      <div className="w-3/4 p-4">
        <h1 className="text-2xl font-bold">اسم الشخص</h1>
        <p className="mt-2">الرقم القومي: 1234567890</p>
        <p className="mt-2">الكلية: كلية العلوم</p>
        <p className="mt-2">المستوى الدراسي: السنة الثانية</p>
        <p className="mt-2">البريد الإلكتروني: example@example.com</p>
        <button className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-700">
          تعديل البيانات
        </button>
      </div>
    </div>
  );
};

export default ProfilePage;
